import React, { Component } from 'react';
import {Section} from 'bloomer';

export class Home extends Component {
  render() {
    return (
      <div>
        <body>
            <Section>
                Meditation
            </Section>   
        </body>
        <Field>
          <Label>Name</Label>
          <Control>
              <Input type="text" placeholder='Text Input' />
          </Control>
      </Field>
      </div>
  );
  }
}

export default Home;
